Pills Time is a personal pharmacy assistant and one of the most convenient medication reminders. You won't forget to take your medicine – our pill reminder will send you a notification! Now improve your health and quickly defeat any disease is much easier.

Make your medication schedule in accordance with the instructions or recipe given to you by your doctor. Flexible configuration will help you to defer or postpone a regular pill intake. Your courses will be archived, so you can return to them as needed!

Our advantages:
- The schedule for the day, week, month;
- Courses by number of medications;
- Taking medicine daily, every few days, weeks, months;
- Any duration and repetition rates;
- Automatic calculation of the remaining medicine;
- The opportunity to save the current medication;
- History of medication doses directly in the calendar.
- Your own database of medicines, pills and vitamins.

Take care of your health – and Pills Time will help you with this!

Diseases Dictionary Offline is complete OFFLINE and FREE app containing list of Medical disorders & diseases that provides all information about symptoms, disorder and treatment and many medical terminology.
This Diseases & Disorders Dictionary hand book can act as a clinical advisor for self diagnosis and can also be used to look up symptoms, diseases and treatment. Medical dictionary free download is like a FREE Doctor at home for common diseases and treatment codes.

Diseases Dictionary - Medical App Features:
1. Offline – It wok offline, no active internet connection is required;
2. Detailed description of all major medical conditions and diseases: 
- definition;
- symptoms;
- causes;
- risk factors;
- complications;
- preparing for your appointment;
- tests and diagnosis;
- treatments and drugs;
- lifestyle and home remedies

3. Easily find needed disease with instant search.
4. Favorites list– you are able to bookmark the Disease item to your favorites list by clicking on the “star” icon.

Who can use this dictionary:
Healthcare professionals, pharmaceuticals, physicians, hospital nurses, medical students, nursing professionals, pharmacy, physician assistants and for students who work in clinical practice & dispensary.

ANATOMIA – SUPERA 

Este é um aplicativo de realidade aumentada, desenvolvido em 3D, que explora a anatomia do corpo humano. 

Destinado, com exclusividade, para uso de médicos em seus estudos e elucidações sobre a estrutura dessa articulação.

Para visualizar os modelos em realidade aumentada, deve-se baixar este aplicativo e posicionar a câmera do celular ou tablet na imagem “ANATOMIA – PÉ", impressa na frente da lâmina (física) de ARCOXIA, previamente entregue aos médicos.

Com navegação intuitiva, a interação se dá de forma simples (obrigatoriamente a partir da leitura da lâmina física), por meio deste aplicativo:

- Posicione a câmera do celular ou tablet na imagem “ANATOMIA - PÉ";

– O ícone em formato de losango, no topo da tela, ativa e desativa as legendas, ocultas nos pontos inseridos em cada imagem;

– As setas ajudam a navegar entre as imagens;

– Tanto o zoom quanto a rotação das imagens são feitos por meio de toques na tela.

Tudo muito fácil e prático!

